import React from 'react'
import { Link } from 'react-router-dom';

const Render = () => {
    return (
        <div className='relative'>
            <div className='ring-1 ring-gray-300 bg-white fixed w-full inline-flex justify-end p-3 px-5'>
            <svg class="w-5 h-5 my-auto" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="3" d="M4 6h16M4 12h16M4 18h7"></path></svg>
                <div className='items-start mr-auto font-bold text-xl my-auto'>Investors</div>
                <Link to="/create" className='items-start cursor-pointer bg-indigo-800 text-white font-semibold text-center rounded px-4 py-2'>Create</Link>
            </div>
            <div className='h-16'></div>
        </div>
    )
}

export default Render
